Selectize.define( 'no_results', function( options ) {
    var self = this;

    options = $.extend({
        message: 'No results found.',

        html: function(data) {
            return '<div style="background: #fff; font-size: 1.25em; margin-top: -.25em; padding: 10px;" class="no_results"><a class="suggest" href="/contact/quip-request">Sorry, no results :(  If you were itching to see something specific, click here to let the Quippers know!</a></div>';
        }
    }, options );

    self.displayEmptyResultsMessage = function () {
        if($('.movies input:first').val() != '') {
            var that = this;
            that.$empty_results_container.css( 'top', that.$control.outerHeight() );
            that.$empty_results_container.show();
        }
    };

    self.refreshOptions = (function () {
        var original = self.refreshOptions;

        return function () {
            original.apply( self, arguments );
            this.hasOptions ? this.$empty_results_container.hide() :
                this.displayEmptyResultsMessage();
        }
    })();

    self.onKeyDown = (function () {
        var original = self.onKeyDown;

        return function ( e ) {
            original.apply( self, arguments );
            if ( e.keyCode === 27 ) {
                this.$empty_results_container.hide();
            }
        }
    })();

    self.onBlur = (function () {
        var original = self.onBlur;

        return function () {
            original.apply( self, arguments );
            var that = this;
            setTimeout(function(){
                that.$empty_results_container.hide();
            }, 200);
        };
    })();

    self.setup = (function() {
        var original = self.setup;
        return function() {
            original.apply(self, arguments);
            self.$empty_results_container = $( options.html( $.extend( {
                classNames: self.$input.attr( 'class' ) }, options ) ) );
            self.$empty_results_container.insertBefore( self.$dropdown );
            self.$empty_results_container.hide();
        };
    })();
});